import './home.css';

import CallIcon from '@material-ui/icons/Call';
import MailOutlineIcon from '@material-ui/icons/MailOutline';


function HomePage() {
    return (
        <div className="site-wrapper">
            <div className="header-wrapper navbar-fixed-top">
                <div className="header-top-wrapper">
                    <div className="container">
                        <div className="row">
                            <div className="right-container">
                                <div className="contact-info"><i><CallIcon style={{fontSize:"small"}}/></i>+91-1234567890</div>
                                <div className="contact-info"><MailOutlineIcon style={{fontSize:"small"}}/>abcdefgh@gmail.com</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default HomePage;
